import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import { fontFamily, textAlign, fontWeight } from '@material-ui/system';
import './upper.css';
import HitIt from  "./img/hit it-01.png"
import Artists from './artists'
import Imagine from  "./img/imagine_dragons.jpg"
import Chain from  "./img/chain_smokers.png"
import Marshmello from  "./img/marshmello.jpg"
import Avicii from  "./img/avicii.jpg"
import Coldplay from  "./img/coldplay.png"
import OneRepublic from  "./img/one_republic.jpg"

const useStyles = makeStyles(theme => ({
  root: {
    fontFamily: "BebasNeueRegular",
    paddingTop: theme.spacing(10),
    paddingLeft: theme.spacing(9),
    paddingBottom: theme.spacing(15),
    background: 'linear-gradient(to top, #000000, #2a1219, #501a28, #771f35, #a1243f, #b02740, #bf2c3f, #ce313e, #c53438, #bc3632, #b4382c, #ab3927)',
    color: 'white'

  },
  row:{
    marginTop: theme.spacing(1),
  },

  imgRow:{
    marginTop: theme.spacing(3),
    marginLeft: theme.spacing(3),
  },

  

  paper:{
    textAlign: "left",
    justifyContent: 'center',
    // background: 'blue'
    

  },

  paperContent:{
    fontWeight: "bold",
    fontSize: "20px",
  },

  leftPart:{
    paddingTop: theme.spacing(5)
  },

  img:{
    marginLeft: theme.spacing(5)
  },


  
}));

export default function Upper(props) {
  const classes = useStyles();

  return (
    <div id="upperContent" className={classes.root}>
      <Grid container>
        
        <Grid item xs={4} className={classes.leftPart}>
            <Grid item xs={6}>
              <div className={classes.paper}>
                <span className={classes.paperContent} style={{fontWeight: "bold" , fontSize: "-webkit-xxx-large"}}>AMP UP <br/>THOSE DBS</span>
              </div>
            </Grid>

            <Grid item xs={4} className={classes.row}>
              <div className={classes.paper}>
              <span className={classes.paperContent} style={{fontWeight: "normal" , fontSize: "-webkit-x-large"}}>MAKE MUSIC ON THE GO.</span>
              </div>
            </Grid>

            <Grid item xs={4} className={classes.row}>
              <div className={classes.paper} style={{paddingTop: '15px'}}>
                <img src={HitIt} alt='Hit It!' width="125px" height="70px" />
              </div>
            </Grid>
          </Grid>

          <Grid item xs={8}>
            
            <Grid item xs={12} className={classes.imgRow}>
              <img src={props} alt='Imagine Dragons' width="150px" height="150px" />
              <img className={classes.img} src={Chain} alt='Chain Smokers' width="150px" height="150px" />
              <img className={classes.img} src={Marshmello} alt='Marshmello' width="150px" height="150px" />
            </Grid>

            <Grid item xs={12} className={classes.imgRow}>
              <img src={Coldplay} alt='Coldplay' width="150px" height="150px" />
              <img className={classes.img} src={Avicii} alt='Avicii RIP' width="150px" height="150px" />
              <img className={classes.img} src={OneRepublic} alt='One Republic' width="150px" height="150px" />
            </Grid>

          </Grid>
      </Grid>
    </div>
  );
}
